import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import styled from 'styled-components';
import { COLORS } from '../styles/colors';

const NAV_LINKS = [
  { to: '/', label: 'Home' },
  { to: '/design', label: 'Design' },
  { to: '/development', label: 'Development' },
  { to: '/custom-ai', label: 'Custom AI' },
  { to: '/ai-automations', label: 'AI Automations' },
  { to: '/production', label: 'Production' },
  { to: '/work', label: 'Work' },
  { to: '/contact', label: 'Contact' },
];

const NavbarContainer = styled.nav`
  width: 100%;
  background: ${COLORS.white};
  border-bottom: 1px solid ${COLORS.offWhite};
  position: sticky;
  top: 0;
  z-index: 1000;
`;

const NavInner = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0.5rem 1.5rem;
`;

const Logo = styled.div`
  font-weight: bold;
  font-size: 1.5rem;
  color: ${COLORS.darkTeal};
  letter-spacing: 2px;
  user-select: none;
  padding: 0.25rem 0;
`;

const NavLinks = styled.ul`
  display: flex;
  gap: 1.5rem;
  list-style: none;
  margin: 0;
  padding: 0;

  @media (max-width: 900px) {
    display: none;
  }
`;

const NavLink = styled.li`
  a {
    text-decoration: none;
    color: ${COLORS.darkTeal};
    font-weight: 500;
    font-size: 1rem;
    padding: 0.5rem 0.25rem;
    border-bottom: 2px solid transparent;
    transition: border 0.2s, color 0.2s;
    &:hover, &:focus {
      color: ${COLORS.red};
      border-bottom: 2px solid ${COLORS.red};
      outline: none;
    }
    &.active {
      color: ${COLORS.red};
      border-bottom: 2px solid ${COLORS.red};
    }
  }
`;

const Hamburger = styled.button`
  display: none;
  background: none;
  border: none;
  cursor: pointer;
  padding: 0.5rem;
  @media (max-width: 900px) {
    display: block;
  }
`;

const MobileMenu = styled.ul`
  display: ${({ open }) => (open ? 'flex' : 'none')};
  flex-direction: column;
  position: absolute;
  top: 60px;
  right: 0;
  background: ${COLORS.white};
  width: 100vw;
  max-width: 300px;
  box-shadow: 0 2px 16px rgba(0,0,0,0.08);
  padding: 1.5rem 1rem;
  gap: 1.25rem;
  z-index: 2000;
  list-style: none;
  @media (min-width: 901px) {
    display: none;
  }
`;

const HamburgerIcon = styled.div`
  width: 28px;
  height: 3px;
  background: ${COLORS.darkTeal};
  border-radius: 2px;
  position: relative;
  transition: all 0.3s;
  &::before, &::after {
    content: '';
    position: absolute;
    width: 28px;
    height: 3px;
    background: ${COLORS.darkTeal};
    border-radius: 2px;
    transition: all 0.3s;
  }
  &::before {
    top: -9px;
  }
  &::after {
    top: 9px;
  }
`;

const Navbar = () => {
  const [open, setOpen] = useState(false);
  const location = useLocation();

  const handleHamburger = () => setOpen((prev) => !prev);
  const closeMenu = () => setOpen(false);

  return (
    <NavbarContainer role="navigation" aria-label="Main Navigation">
      <NavInner>
        <Logo tabIndex={0} aria-label="Logo placeholder">LOGO</Logo>
        <NavLinks>
          {NAV_LINKS.map((link) => (
            <NavLink key={link.to}>
              <Link
                to={link.to}
                className={location.pathname === link.to ? 'active' : ''}
                tabIndex={0}
                aria-current={location.pathname === link.to ? 'page' : undefined}
              >
                {link.label}
              </Link>
            </NavLink>
          ))}
        </NavLinks>
        <Hamburger
          aria-label={open ? 'Close menu' : 'Open menu'}
          aria-expanded={open}
          aria-controls="mobile-menu"
          onClick={handleHamburger}
        >
          <HamburgerIcon />
        </Hamburger>
      </NavInner>
      <MobileMenu open={open} id="mobile-menu" role="menu">
        {NAV_LINKS.map((link) => (
          <NavLink key={link.to}>
            <Link
              to={link.to}
              className={location.pathname === link.to ? 'active' : ''}
              tabIndex={0}
              aria-current={location.pathname === link.to ? 'page' : undefined}
              onClick={closeMenu}
            >
              {link.label}
            </Link>
          </NavLink>
        ))}
      </MobileMenu>
    </NavbarContainer>
  );
};

export default Navbar;
